,(173,'Marc','Backes',NULL,'I\'m a 29-yo entrepreneur born and raised in Luxembourg, but since 4 years I live in Mexico.\n\nEntrepreneurship caught my eye around two years ago, when I started reading \"Lean Startup\". I inscribed to an Innovation bootcamp here in Mexico and ever since I am developing new things.\n\nMy first failed business was a food delivery platform here in local Xalapa. Since November 2015 I\'m working on something that really interests me, because I have experienced an ugly situation (kidnapping) in my family. It\'s a service (first stage a mobile app) which detects when the user is in trouble and alerts friends & family in that case.\n\nWe are close to launching the Beta. But we\'re still missing some talent and also just honest input about the service.\n\nAlso, I am always looking to get in touch with fellow entrepreneurs and keep a connection on their advance. Over all, solving problems fascinates me, so I want to hear all about it :)','Xalapa','Mexico',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766602/dn0bp1zpvkr6kucmt8sx.jpg','discover new things','Male','1987-01-31T06:00:00.000Z',10209385530454356,'CAAG7LqtfGXYBAOS3hxGV8tOD5zpnOzigWJcCBoODId6AZCquienR7vlzdomPaC1vh9esgzckWifoUfxPBfAH4yq9Map0XEOGgZBw783GuoAjji3VRzMHx1YsFdbEBOyqi9tbZBG31snt49G7d5RlvxM5DWeRpXQhBE9lCZAE2yFep1AyCWWiItT9ZCmVuEoRzrpfVlIXbFQZDZD',0,'','','','','2016-04-27 14:00:57','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766592/baabacsb4ahzq1to5epz.jpg',174,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766602/dn0bp1zpvkr6kucmt8sx.jpg','Marc.Backes','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766592/ibvydtnp6bgpmxkywcbl.jpg'),(174,'Diego','Guadarrama',NULL,'I am a chemical engineer on paper, but a product builder at heart. A couple of projects I\'ve built: buggit.com and getlivepost.com.','Monterrey','Mexico',NULL,NULL,NULL,NULL,NULL,'https://lh4.googleusercontent.com/-a18H8dqj8jg/AAAAAAAAAAI/AAAAAAAAAAw/FWr