4htzbouexice.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462025516/aqgrdfl6baynjtw5zswb.jpg'),(207,'Irina','Kirsanova',NULL,'Hi,   I worked teams  in London, Moscow and France, Canada as a Senior Designer. +10y.o experience in Web and Branding campaigns.\n\nBrands and companies I collaborated: Disney, Coca Cola, Nokia, MTV, Muppets, Star Wars, Club Penguin, Frozen, Schlumburger. I now work with start ups and companies. I like  to meet new people and to do projects with idea. \n\nWhen I was a student I wend to London galleries and museums trying to analyze the composition rules, geometry of line.  It helps to do great pieces in Branding & UI design now with understanding . I am not a gold-digger here, I just love what I do and always try to go above the expectation.\n\nSpecialties: Branding,  UI/UX (+code),  Apps, web, Landing pages, presentations, print.\nMy Previous roles included: Senior Production designer, Company designer, Agency Designer, Editor.\n\nSkills:  Adobe (Photoshop, Illustrator, InDesign, Flash, Lightroom), 3Ds Max, Google Analytics, Sketch, InVision, Slack, Trello, JIRA, Confluence, SVN,  HTML, CSS \n\nWant to work with you soon. \nI can lead a project A to Z with my team of coders or to be a part of your team for short time.\n\nThank you,\nIrina    \n \n\nPortfolio: www.behance.net/kirsanova\nLinkedIn:  uk.linkedin.com/in/ikirsanova \nskype:irina.kircanova\nwhatsup: 7 903 9766292','London','United Kingdom',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462094739/locs1u7t9bstshcoqbcv.jpg','join projects','Female','1983-06-08T21:00:00.000Z',0,'',0,'','','','','2016-05-01 09:25:21','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914635/default_cover/photo-1428976365951-b70e0fa5c551.jpg',236,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462094739/locs1u7t9bstshcoqbcv.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914635/default_cover/photo-1428976365951-b