4dfa672c.jpg',1,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAENIifYZCZBdMf90N8CHiJprg2NZAzTeUnoZCaENDz3hI9ry2fDIDFhqMEmmRbLaN3nxEakHBXa3FgNH5TrRWeDfNGPGBWFNAryDu1F7J7Y6nfaS43HAqa0udQb1jwJaYG62ZAUmcNlnmjvfWQykZD','Dale.Eastman','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914588/default_cover/photo-1452596954042-4ccc4dfa672c.jpg'),(277,'Kwesi','Ferebee',NULL,'Hello, hello! I\'m a graphic designer looking to do several things. One, is to learn more about UI Design and Motion Graphic. I\'m starting to see that, while I love graphic design, I have more of a passion for illustration (static and animated) and would love to make a living doing what I have a passion for.\n\nSecond, I\'m also getting more involved with my fine art projects (painting, printmaking, and mixed media pieces). I\'m still pretty new to the Bay and when love to find a community of artist I can fellowship and create with.\n\nThat is all. :)','Vallejo','United States',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462410348/ektqwzvf66xr8kxdnagd.jpg','discover new things','Male','1974-10-06T07:00:00.000Z',0,'',0,'','','','CA','2016-05-05 00:56:27','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914638/default_cover/photo-1422157245273-e08b638b4b00.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462410348/ektqwzvf66xr8kxdnagd.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914638/default_cover/photo-1422157245273-e08b638b4b00.jpg'),(278,'Kwesi','Ferebee',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBACcXBHZBx9SlONsox8Mhz7RaotR7g7ZBtytD2LIup81Y73Xjr7diLUCWBCJSJ4hitZCyUySfZBAjlZAHNyl9XbZBvkklcxym4PnI9bcygTgKZC8xelcodLSBZBnOuhKFpTNDh2NcBa4ss7kNv0SNFAcZD',NULL,'male',NULL,10154239465832608,'EAAG7LqtfGXYBACcXBHZBx9SlONsox8Mhz7RaotR7g7ZBtytD2LIup81Y73Xjr7diLUCWBCJSJ4hitZ