INSERT INTO `project_asks` VALUES (2,1,'What type of brands will you guys feature ?','Will we find mainstream brands (ie: Nike, Adidas, NB etc) or are you more into word to mouth designers?',1,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere','2016-04-28 13:29:50',34474),(3,4,'Does it take the form of a mobile app?','',56,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Jeanne','Coleman','2016-04-28 13:49:13',59887),(4,14,'Any more pictures you can share ? :)','',125,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-04-28 17:16:39',25450),(5,5,'Can you please add some pictures and / or a video showing the bike details ?','',55,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Igor','Gourevitch','2016-04-29 09:59:37',54246),(6,14,'Do you plan to develop other type of bikes / frames ?','I would LOVE a race bike or a commuter bike like the WoodRover',55,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-04-29 10:01:57',54246),(7,264,'Where do i can buy one ?','I really like your product and i wanted to know where i can buy your glasses.',59,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAAgGDSbux9EtB1aEZCCX0DyiVaaH2xu8dcdgZCbKLy35HpSFVQbSmnA1FkTiouQC2EuQvTY7BC4PPUnrJj8sHFJF6v6kMwGLeRhO5j1zs3vShNY0ZChtVqzZANH7uFrgP3xNy8jT7rFkxZCV7YOEZD','Cédrick','Le Guen','2016-05-04 21:12:57',61750),(8,1,'LOVE it !','',136,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8Z