INSERT INTO `projects` VALUES (1,2,16,'Sneakerdot','Shop and collect sneakers from a number of stores','New York','','NY','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/khzrojhuriq03qe71tk3.jpg','<h1></h1>\n\n<h1>Coming Spring 2016</h1>\n\n\n\n<hr>\n\n\n\n<p><strong>Sneakerdot</strong> is a marketplace where users can shop and collect sneakers from numerous stores including Mr Porter, Matchesfashion and End Clothing, while also having the latest news and sneaker release dates.</p>\n\n<hr>\n\n<p><br></p>\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648173/rq4wh8evex5ijdfkkwsj.jpg\" data-image=\"\" style=\"text-align: center; font-family: Arial, \'Helvetica Neue\', Helvetica, Tahoma, sans-serif; font-size: 15px; line-height: 24px;\"></p>','Beta project',NULL,46,34474,'Sara Peterson','','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/ke4znwli5yz2gz5v721p.jpg',1,NULL),(3,4,4,'Delepaule Bags','Delepaule is the urban bag which allow you to not choose.','Berlin','','Germany','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/zb6t1hh9thpkphslp8xi.jpg','<p><u><strong>DELEPAULE</strong></u><br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is a whole range summed up in a single product! Get it and choose later how you are gonna use it, according to your mood, your schedule, your lifestyle. This is an ambitious project, based on local economy and short cycle, but with a global scale. If a country distributes&nbsp;<strong>Delepaule,</strong>&nbsp;it means that the bag is manufactured in the country. The identity of&nbsp;<strong>Delepaule</strong>&nbsp;will be built on the divergence of techniques and cultures. It is based on the valorization of these cultures through details and finishes made, always with the single watchword: quality at any trial for a bag that can follow you anywhere!<br>&nbsp;<br>&nbsp;</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653424/fiqfg3mteogsieunwagl.jpg\" data-image=\"\"></figure>\n\n<p><em><br>&nbsp;<br>It all started with the frustration of having to choose.<br>&nbsp;<br>The brand philosophy, the identity, the policy made a brand unique. It is easy to federate to an idea, but much more complicated to seize it. Indeed, each brand offers a whole range of products in which the consumer has to choose.<br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is based on : An idea, a philosophy, a product.<em><br>&nbsp;<br>&nbsp;<br>Delepaule is not just a bag, is also a new idea of business model. Based on the short distribution channel values (local, social, well-made,&nbsp;environmentally responsible) and the global distribution of standard channel, Delepaule wants to create a huge stylist network who will create and&nbsp;distribute the bag on their own country. Each product&nbsp;will be slightly different, and it will be for the best ;D<br>&nbsp;<br>&nbsp;<br><em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653443/jdnnmbem5uuj3qbvnplj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><br>&nbsp;<strong>Delepaule</strong>&nbsp;offers you the right not to choose. You like the idea? Agree with it by adopting the product, and choose later how you will like to wear it.<strong>Delepaule</strong>&nbsp;gives you the possibilities of a whole range in a single product. Assemble & disassemble it as ease as a construction game!<em><br>&nbsp;<br>The&nbsp;<strong>Delepaule</strong>&nbsp;is composed of three parts : The main bag, which as two large pockets (vertical & horizontal) able to welcome a 15\" laptop. The small bag, which is able to carry a 10\" tablet. And two straps that you can assemble as you want, to create the most suitable bag for you and your needs : backpack (2 or 3 pockets), messenger, shoulder bag or tablet bag.<br>&nbsp;<br>The idea came up in Barthélémy Delespaul street, in Lille. M. Delespaul was a industrial specialized in linen spinning (start of 19th century). The name :<strong>Delepaule</strong>&nbsp;is a tribute to the history & the culture of my region, mixed up with a bit of humor : le sac de l\'épaule (the bag on a shoulder).<br>&nbsp;<br><em></em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653457/xeyoulve0dpws2uonhhj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br>&nbsp;<br>&nbsp;The fabrication of the bag respect a strict policy : the highlight of the different actors of the project. The bag is made by a stylist using fabrics from Europe. The distribution is in the same country that the manufacture. In that way, materials and technics used can be different from one country to another, adding value to the bag thanks to a local knowhow.&nbsp;<br>&nbsp;</em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653548/bs3axauo6kdwixsa9er6.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br><em>The bag is unique but declinations are multiples. Before using it as you wish, you will be able to find it in several versions, giving you a feeling of uniqueness.<br></em></em></em></em></em></em></p>\n\n<ul><li><em><em><em><em><em><em><em><em><em>&nbsp;version available in 3 color combinaisons. (night, brick, mustard)</em></em></em></em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>version created by the stylist every seasons.</em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>limited edition in collaboration with artists, the bag becomes a expression area.</em></em></em></em></em></em></li></ul>\n\n','Beta project',NULL,92,40502,'Jeanne Coleman','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Fashion','0px -335px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/ygtny2dvmdvqtrsixkyr.jpg',1,NULL),(4,5,16,'Pine64','PINE A64 is the world\'s first 64-bit expandable Quad Core 1.2Ghz supercomputer, starting at just $15','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/kizncswdexdoqkryxfc6.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/3CKO9kWLxS4\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n<p><br></p>\n\n\n\n<p>PINE A64 is not only a computer, it is a super affordable 64-bit high performance expandable single board computer (SBC). &nbsp;Whether you are an IT professional, electronics hobbyist, student, teacher, hacker, inventor, or just someone who wants to have more flexibility to increase their productivity at work, the PINE A64 is a computer board made for everyone. &nbsp;Enjoy more fun and entertainment at home with endless possibilities.<br></p>\n\n<h1></h1>\n\n<h1>PINE A64 is Small</h1>\n\n<p>The PINE64 CPU is a quad-core ARM A53 64-bit processor that runs at 1.2GHz.&nbsp;</p>\n\n\n\n<p>The GPU on the PINE A64 is a dual-core MALI-400 MP2 and runs at 500MHz, capable of 1.1 Gpixel/s throughput. This means the graphics capabilities are slightly higher than the original X-Box\'s level of performance. &nbsp;</p>\n\n\n\n<p>PINE A64 board is powered by the latest 64-bit quad core ARM A53 CPU and delivers up to 20-30% better performance than other 32 bit open source counterparts.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653903/s5jmcwgfadglhzshunps.jpg\" data-image=\"\"></figure>\n\n<h1></h1>\n\n<h1>PINE64 is Expandable</h1>\n\n<p>Add different hardware interfaces to your PINE A64 as you see fit. Depending on whether you pick the PINE A64 or PINE A64+, the PINE A64 ships defaults with two USB ports, HDMI output, 3.5mm Audio/Mic Output, ethernet port, and two I/O expansion buses. On the more advanced PINE A64+ model, you will receive three additional ports to add optional accessories such as: camera module, touch panel module, and the LCD Panel port.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653975/t4v4ihrcvx6p9qmslhcf.jpg\" data-image=\"\"></figure>\n\n<p><br></p>\n\n<p>PINE A64 is Versatile<br></p>\n\n<p>Add a keyboard and mice and turn PINE A64 into a full Android 5.1 computer to run Chrome Browser, Microsoft Word, Excel, Powerpoint, or even watch your favorite shows on YouTube.<br></p>\n\n<p>Load special versions of Android 5.1 and launch media players to turn this into an advanced Apple TV-like Android product. &nbsp;<em>PINE A64 supports miracast.</em><br></p>\n\n<p>Install a touchscreen module and choose from hundreds of thousands of games from the Android store to build your own arcade.&nbsp;<br>Play your favorite games on the big screen!</p>\n\n<p>Build a custom enclosure to use the PINE64 in your next innovative project.</p>\n\n<p>Because PINE A64 is an open source platform, you can load anything you want but we suggest to pair PINE A64 with Ubuntu, Android or openHAB IoT. By aligning the PINE A64 to be compatible with these operating systems, you basically get access to over 1.7 Million apps* on the market today, from utilities, games, and media apps.&nbsp;<br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458654106/lafheonrevmp0fgmihhz.jpg\" data-image=\"\"></figure><p><br></p>\n\n<p><br></p>','Beta project',NULL,156,46397,'Igor Gourevitch','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Technology','0px -231px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/icpk2iq7b164kywr7x2z.jpg',1,NULL),(6,11,16,'Modular Smartwatch','Choose the modules you want to build a smartwatch unique to you.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690636/strpo46szso36quglhtr.jpg','<h1>Engineering Prototype:</h1><p>BLOCKS is the world’s first modular smartwatch. Compared to our phones, smartwatches are small and have limited space inside. This means that other smartwatch companies are having to compromise on which features they to put into a tiny little device that fits around your wrist. We wanted to give that power back to you, the user, to choose what features are important just for you.</p>\n\n<p>BLOCKS breaks away from compromise with a unique design. Start simply with the watchface, also known as the Core, which is a fully functioning smartwatch on its own, then add Modules into the strap to enhance functionality of your watch. You can choose ANY Modules you want and connect them together to build a smartwatch unique to you.</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690952/l3tjbnchkctvyql5oves.jpg\" data-image=\"\"></figure><h1>Elegant Interface</h1>\n\n<p>We’ve designed the user experience to be as intuitive and simple as possible. Notifications, activity tracking, and the additional features of all your Modules are available at the flick of a finger. These are preliminary designs are subject to change.</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691070/tih82sjqpebtwrupmkmr.png\" data-image=\"\"></figure><p>Operating System</p>\n\n<p>BLOCKS\' operating system is based on the latest version of Android and is running on a powerful and efficient Qualcomm processor. With the help of Qualcomm and our other software partners, we have optimized our Android OS for power consumption.&nbsp;</p>\n\n<p>We are using Android, which like BLOCKS, is an open-platform. With Android it is easy to develop apps and to implement our modular framework. A lot of developers already have apps on androids, and they only need to optimize their apps to work on the watch.</p>','Live project',NULL,46,67638,'Serge Didenko','','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457690636/y5pru3xbqadzkxxlqcoh.jpg',1,NULL),(7,12,2,'Brace Leather','Beautiful leather accessories for life on the go','Chicago','','IL','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692081/ujuqfw65cec0k8odp6ty.jpg','<h1>Brace makes your life easier.&nbsp;</h1>\n\n<p><strong>Brace Leather</strong>&nbsp;is dedicated to design that is minimal, simple, and beautiful. Our goods are designed and crafted by experienced artisans with long-lasting and beautiful materials. Man Overboard is our first collection, a set of essential leather accessories for cafe life or work on the go.&nbsp;Our beautifully designed leather accessories are the essentials you need for life’s everyday adventures.&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692324/ywpvi9xu4zp5y6l9hwag.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>We need your help</h1>\n\n\n\n\n\n<p>We are very excited to introduce to you the Man Overboard kit: the essentials for life on the go. Our goal was simple: to use the inherent beauty of leather to create a beautiful set that will be functional, simple and last a lifetime. We are making the whole kit available on Kickstarter for purchase, along with each piece sold separately.</p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692271/k1w5xcftw0qd8fejkuoy.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<h1>Our Leather</h1>\n\n\n\n\n\n<p>We only work with full grain leather which is the highest quality leather available on the market. Full-grain leather refers to hides that have not been sanded, buffed, or snuffed to remove imperfections or natural marks on the surface of the hide. This means each of our pieces will be naturally unique. Rather than wearing out, it will develop a patina over time. Our leather will wear beautifully and it will actually look better as it ages!</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692296/emegpfalbancuutw6pp1.jpg\" data-image=\"\"></p>\n\n\n\n\n\n<p>This beauty will take your laptop and your favourite magazine/ipad/notebook out on an adventure.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655151/lyxpz6o8ktoxxvz3wqxd.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>','Idea','',143,28914,'Sebastian Moresta','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691617/vefkdhglnraxr2owpfji.jpg','Craft','0px -247px','h4dj0hxldvj2mjrm6yyk','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692087/sdmxm6vfsz8cj5rpo5mi.jpg',1,NULL),(9,14,7,'Secret Hitler','A social deduction game for 5-10 players about finding and stopping the Secret Hitler.','Montreal','','QC','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/lomxex9ss2yzjw1dsxbu.jpg','<h2>What is Secret Hitler ?</h2>\n\n<hr>\n\n\n\n\n\n<p>Secret Hitler is a dramatic game of political intrigue and betrayal set in 1930\'s Germany. Players are secretly divided into two teams - liberals and fascists. Known only to each other, the fascists coordinate to sow distrust and install their cold-blooded leader. The liberals must find and stop the Secret Hitler before it’s too late.<br></p>\n\n\n\n\n\n<p>Each round, players elect a President and a Chancellor who will work together to enact a law from a random deck. If the government passes a fascist law, players must try to figure out if they were betrayed or simply unlucky. Secret Hitler also features government powers that come into play as fascism advances. The fascists will use those powers to create chaos unless liberals can pull the nation back from the brink of war.</p>\n\n\n\n<p><br></p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693688/el7ny7wm7unmzlgtgo8y.jpg\" data-image=\"\"></figure>\n\n\n\n<p><br></p>\n\n<h1>How do you play ?</h1>\n\n<p>In Secret Hitler, each player is randomly assigned to be a liberal or a fascist, and one player is Secret Hitler. The fascists know in advance who Hitler is, but Hitler doesn\'t know who his fellow fascists are, and the liberals don\'t know who anyone is. Since the liberal team always has a majority, the fascists must play like moles, gaining the trust of the liberals to sabotage their plans and make them suspicious of each other.</p>\n\n\n\n<p>The objective of the liberal team is to pass 5 liberal policies or assassinate Secret Hitler. The objective of the fascist team is to pass 6 fascist policies or elect Secret Hitler chancellor after 3 fascist policies have passed.</p>\n\n\n\n<p>Each round, the President selects a Chancellor. The whole table votes \"Ja!\" or \"Nein!\" on their ticket; if a majority of players vote “Ja!,” the elected President and Chancellor take the following actions to pass a new policy:</p>\n\n\n\n<p>The President draws 3 policies from a random deck.<br>The President discards 1 policy and passes 2 to the Chancellor.<br>The Chancellor discards 1 policy and enacts the final one as law.<br>If a fascist policy passes, the President gains a new power that she must use immediately.&nbsp;</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655577/qklmfj1k4mklzmoct8x9.jpg\" data-image=\"\"></figure><h1>What is so special ?</h1><p>Secret Hitler is a love letter to hidden identity games like Werewolf/Mafia, The Resistance, and Avalon, but it\'s also a new design that fixes some of our biggest problems with those games.</p>\n\n<p>No moderator: Secret Hitler doesn\'t require a moderator - everyone can join in the game.<br>No early player elimination: We love the suspense of player elimination, but Secret Hitler saves that drama for the very end&mdash;assassinated players will rarely have to wait more than ten minutes before the game ends.</p><p>In games like Werewolf, you can only act on your gut feeling. Secret Hitler creates a much more heady experience - there\'s almost enough information that you can solve the game like a puzzle, but not quite enough. Players always have enough information to make meaningful choices, but we\'ve simplified the decisions to avoid analysis paralysis; each round the President nominates a Chancellor, and the table votes yes or no to that ticket.</p><p><b>Why is Secret Hitler set in 1933 Germany?</b>&nbsp;</p><p>We believe that the theme and setting of a game work best when they help explain the story and mechanics.<br></p><p>Hitler’s takeover was, for a dictator, surprisingly political: he wasn’t a general who subverted a popular revolution, he wasn’t backed by foreign interests, there wasn’t a total collapse of government he took advantage of. He used the rickety systems of the Weimar Republic to gain power mostly legally; he was handed the Chancellorship by men who thought they could \"control\" him.</p>\n\n<p>Hitler and his allies spent years manipulating the levers of democracy, accumulating power in a snowball effect. He divided and intimidated his rivals. He used national crises to strengthen his own position. His followers were organized and brutal, and his rise was equally engineered and opportunistic. There were good men who didn\'t understand how dangerous he was until it was too late, and there were bad men who wanted power for themselves but were outmaneuvered.</p>\n\n<p>Social Deduction games are about a well-coordinated minority trying to convince a confused majority to vote against its interests. It\'s an inherently political genre.</p>\n\n<p>We set out to make a game to help us reflect on the ways that others - good, bad, indifferent - were complicit in Hitler\'s rise to power. Our game doesn\'t model the specifics of German parliamentary politics. Instead, we try to model the paranoia and distrust he exploited, the opportunism that his rivals failed to account for, and the disastrous temptation to solve systemic problems by giving more power to the \"right people.\"</p>','Idea',NULL,36,11285,'Max Tolkin','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Games','0px -163px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/kdlzyuywfdkombfkg7uo.jpg',1,NULL),(10,15,14,'Pixelio 3D','First Portable All-in-One & Easy-to-Use 3D Scanner','Shanghai','','China','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/dbqd6scilxpna4r26144.jpg','<h1>What is Pixelio 3D ?</h1><p>Using the latest 3D technology Smart 3D Ltd has created Pixelio. Pixelio is an innovative, modern and easy to use 3D scanner that can be used by everyone!</p><p>Until now, the market has lacked a good and low cost device for 3D printer users that allowsto copy objects, make spare parts, or archive collections in the form of 3D files.</p><p>Smart 3D Ltd team createsa device that fill this gap. The company also wanted to add some simpleand clever features to theirsmall devices. That is why&nbsp;Pixelio&nbsp;– the first baby of Smart 3D became also a device that helps to improve your photos or even movies. &nbsp;</p><p>Pixelio will introduce you to a new dimension in 3D photography.<br>With Pixelio scanner you can enjoy high-tech features for a reasonable price. All you need is a smartphone or gopro camera.</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694556/w5aydr3esev57ast5kss.png\" data-image=\"\"></figure><p><br></p><h1>Who is Pixelio 3D for ?</h1><p>Everyone will find Pixelio useful!</p>\n\n<p>Affordable and user-friendly it should satisfy the most demanding photographers and 3D printer users. Pixelio does not have its own optics as for that purpose, it uses your smartphone camera and a free app (eg. 123D Catch). That makes it even more accessible.</p>\n\n<p>Featuring a wide range of functionality Pixelio will be perfect for:</p><ol><li>sellers on eBay, &nbsp;other auction sites</li><li>bloggers and vloggers</li><li>graphics</li><li><span></span>real estate developers</li><li><span></span>architects, engineers etc.&nbsp;</li><li><span></span>or even tourists who want to take the best panoramic pictures.</li></ol><p>Pixelio is a simple and fast way to create amazing 360 degree photos! This option will particularly appeal to you if you sell on the Internet, write a blog or deal with professional product photography. The process of creating pictures is automatic. 360 degree photos can be saved to MP4 or GIF format.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1457694539/wgi7ix2t2zhwedhaxvxh.mp4',86,30536,'Hu Tang','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694177/nsei9eggjayb8ifodvdq.jpg','Science','0px -207px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/tyvw4l3ieuahlye7enjb.jpg',1,NULL),(13,22,11,'Kien','the first flexible sound system. High quality sound for everyone','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/ci2e5te5vsusdnmfofj6.jpg','<p>Hey everyone! You guys are going to love this: our creative director is showing the feature of cycling a sat between grouped and individual mode!</p>\n\n<p><br></p>\n\n<p>Audio is important in our lives. At kien we are determined to bring you a new breed of sound system that allows you to share audio with your friends anywhere and in any imaginable way you want: Dolby® surround sound, Hi-Fi stereo, multiroom, all made portable. Kien covers it all. Set your speakers up wherever you want: in your house or even outside. Start enjoying audio the way you want it.<br></p>\n\n<p><br></p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698029/cxqzscmnsnoosfve5zip.gif\" data-image=\"\"></figure>\n\n\n\n<p>Enjoy stereo sound from our wonderful sound system by bluetooth.</p>\n\n<p><br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698294/euugyqw46zii5okdsk8v.gif\" data-image=\"\"></figure>\n\n\n\n<p><br></p>','Drafted project',NULL,38,84083,'Florent Gautin','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Music','0px -367px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/wfc9mihrvnoi185nlvrh.jpg',1,NULL),(17,42,6,'food','','Paris',NULL,'France','','','Idea',NULL,13,93642,'Clotilde Moreau','','Food','','','',1,NULL),(21,7,16,'Spritz','Save time, increase focus and have fun.','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969236/k4fstru1o2chdkla4jf3.jpg','<h1></h1>\n\n<figure><a href=\"https://www.netlify.com/docs/ssl\" target=\"_blank\"><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969624/z5tvelcefk6hphf5mkhs.png\" data-image=\"\" alt=\"Première photo\" title=\"Première photo\"></a></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1></h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>The Science&nbsp;</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Spritz worked for nearly 3 years in “Stealth Mode” to perfect our reading methodology before we introduced our technology to the world. We learned a lot in that time and developed our findings into the core technologies that you see here today. As an introduction to how and why Spritz works let’s start off with a few basics about reading.<br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Reading Basics</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Traditional reading involves publishing text in lines and moving your eyes sequentially from word to word. For each word, the eye seeks a certain point within the word, which we call the “Optimal Recognition Point” or ORP. After your eyes find the ORP, your brain starts to process the meaning of the word that you’re viewing. With each new word, your eyes move, called a “saccade”, and then your eyes seek out the ORP for that word. Once the ORP is found, processing the word for meaning and context occurs and your eyes move to the next word. When your eyes encounter punctuation within and between sentences, your brain is prompted to assemble all of the words that you have read and processes them into a coherent thought.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/2WpGR_i8ckU\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Why Spritz is Different</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>There are lots of other reading techniques out there such as skimming (not reading every word), avoiding sub-vocalization (talking to yourself while reading) and enlarging the peripheral span (reading an entire page at a time by mental “snapshot”) that attempt to increase reading speeds. While these methods can be effective, achieving significant improvement requires intensive, continuous training and dedication. By contrast, spritzing can be learned in less than 5 minutes and, if you don’t spritz for a month, no practice is needed to return quickly to your previous speed or skill-level.In addition, none of these methods mentioned above help you unless you’ve got a lot of physical space for your content. From the fonts that we use to the algorithms that process content, Spritz is designed from the ground up to empower effective reading on a small display area. There is a lot more to Spritz than just reading fast!</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969584/ixaqfm9wjooln514mile.gif\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h1>Spritz Technology</h1>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Spritzing presents reading content one word at a time with the ORP positioned inside of our custom \"redicle\". &nbsp;Within the redicle are special prompts that keep your eyes focused on the ORP, allowing you to read without the need to move your eyes. With this approach, reading is more efficient because spritzing decreases the time spent searching for each word’s ORP. &nbsp;The following video compares traditional reading to Spritz and is a real eye-opener when it comes to the efficiencies that are gained by placing words exactly where your brain wants them to be located.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461424146/ajui1i4ethqebrfpibcn.mp4',297,57415,'Maxence Mson','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458587075/ejrk6p8i4fxn8qqfg87l.jpg','Technology','0px -199.85px','ajui1i4ethqebrfpibcn','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457969237/ta5fmgmjfxqwljlsllon.jpg',0,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461510563/bvnc6gsaxemm0f7vlvcu.jpg'),(28,52,16,'Connexion','','Paris',NULL,'France','','','Live project',NULL,10,41058,'Charlotte Hamelin','','Technology','','','',1,NULL),(29,77,16,'Whire.me','','Paris',NULL,'France','','','Beta project',NULL,19,29239,'Hugo Côté','','Technology','','','',1,NULL),(53,3,14,'Robotic Extrusion','A printing head led by KUKA R900 produced self-supporting structure(ABS)','Cambridge','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/dcxxo738epemfwb0mmcq.jpg','<h1>ROBOTIC EXTRUSION</h1><hr><p><br></p><p><em>Research of Digital Craftsmanship & Autonomous Fabrication</em></p><p>&nbsp;<br>The project, Robotic 6-Axis 3D Printing, is a highly-integrated installation combining robotics, 3D printing technique and interactive interface. It aims to provide the designer a digital method to eliminate the line between \"Designing\" and \"Fabricating\". In this case, architects provides more than just drawings and construction notes, however, they are capable of fabricating their work quickly and precisely by themselves.<br>&nbsp;<br>Most of today\'s researches and applications of robotic fabrication are limited to replicating human labor and raising efficiency of manufacturing. However,&nbsp; in the project of Robotic 6-Axis 3D Printing, we developed a fabrication strategy learning and emulating the law of nature (referring to Chinese philosophy \"师法自然 \"). By studying the material and structure performance of 3D form in nature, we figured out a way to incorporate biomimetic fabrication strategy into 3D printing process. And by designing the special robotic-end effector (Tooling) and utilizing the great flexibility and accuracy of KUKA robotics, the biomimetic fabricating process has been fully realized.<br>&nbsp;<br>The whole process embodied the concept of \"Digital Crafsmanship\", which emphasis the personality of designer and allows them to closely intergrated \"Designing\" and \"Fabricating\".<br>........................................................................................................................................................................................................</p>\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/5c8b1722536831.5631453917ac1.jpg\"></p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/39743222536831.5631453192288.jpg\"></p>\n\n\n\n\n\n<p>Whole Printing Process / Freeze Frames of the Movie</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<em class=\"redactor-inline-converted\">\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 01: BIOMIMETIC CONCEPT & SIMULATION<br>&nbsp;<br>3D printing technology has great potential in future fabrication field, however, it is unconvincing to address it with the name of future craftsmanship. This manufacturing process has limitations in spatial flexibility and fails to perform a fabrication structural strategy. It is because the current 3D printing technology mostly relies on the superimposition of thermoplastic ABS/PLA material along direction of gravity.<br>&nbsp;<br>Robotic 6-Axis 3D Printing project uses the same material (ABS) but has make a breakthrough in the way it prints. By mimicking the micro-structure of spider silk thread, a specific fabrication strategy has been added into this process. This change makes it possible to print simple self-supporting forms and is capable to show how the form grow from the ground. In this way, the material develops its full potential to expanded the materiality through the biomimetic printing progress.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/4bb7c522536831.563145124af3f.jpg\"></p>\n\n\n\n\n\n<p>Structural Inspiration from Spider Thread</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/59f29e22536831.56314516a11bc.jpg\"></p>\n\n\n\n\n\n<p>Reinforcement of Linear Structure of ABS Material</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6713c122536831.5631450ed6869.jpg\"></p>\n\n\n\n\n\n<p>Structure&nbsp;Simulation Before Fabrication (Software Simulation & Physical Model Simulation)</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 02: DESIGN OF THE PRINTING HEAD(ROBOTIC END-EFFECTOR)<br>&nbsp;<br>In 6-Aixs 3D Printing project, the idea of biomimetic structure is realized by a delicate robotic-end effector. The core component is a petaloid turn-plate, which has 3 movable printing head attached alongside and 1 fixed printing head in the center. When the whole system is powered by a servo and start functioning, the rotation of turn-plate leads to the oscillating motion of 3 movable printing head, which in turn produce the spindle-knot-like motion trail.<br>&nbsp;<br>The printing module is standardized 3D printing module based on thermo-plasticity of ABS material. The temperatures sensor and heater inside the module take precise control of the printing process. As a result, the 3D printing system, combined with the mechanical system, is capable of printing the biomimetic structure.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/16b07b22536831.56314572339fc.jpg\"></p>\n\n\n\n\n\n<p>Functioning Tool Head (2 Printing Status)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/3e1eed22536831.5631452975b5d.jpg\"></p>\n\n\n\n\n\n<p>Axon Illustration of the Printing Head(Robotic End-effector)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/d938bd22536831.5631457c339c6.jpg\"></p>\n\n\n\n\n\n<p>Exploded Axon Illustration of the Printing Head (Robotic End-effector)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/e78dac22536831.563144e39a679.jpg\"></p>\n\n\n\n\n\n<p>Close-up of Explode illustration - Core components of the system</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 03: DESIGN OF EXTERNAL DIGITAL CONTROL SYSTEM&nbsp;<br>&nbsp;<br>The programming of the robotic-end effectors is based on Arduino. Each printing head has a heater inside which is uniquely programmed and can precisely maintain the temperature in appropriate range. Also there are tubes sending compressed air to the front of printing head to cool and finalize the material. Four material(ABS) deliver system driven by 4 individual servos works like normal 3D printing devices. Besides, one motor is responsible for the rotating motion of the central turn-plate. Both the speed of delivering and rotating can be changed via the switches on the center stack. In this case, the shape of the structure can be adjusted following the designer\'s idea.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f6b87022536831.5631456e6d3aa.JPG\"></p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f9037622536831.5631456e5d9c4.jpg\"></p>\n\n\n\n\n\n<p>Components of External Digital Control System</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6ce45522536831.5631456fde1be.jpg\"></p>\n\n\n\n\n\n<p>Work-flow Diagram of the Circuit System</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/278f3322536831.5631456e6623b.JPG\"></p>\n\n\n\n\n\n<p>Close-up view of the Circuit System</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>FABRICATION PHOTOS (PROGRESS/PRODUCTION/EXHIBITION)<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\"><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/1fe83b22536831.56314899358da.JPG\"><br></em></p>\n\n</em>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461944679/b8cszlvdfjkyr8wrno51.mp4',547,77941,'Henry Wei','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','Science','0px -43.075px','b8cszlvdfjkyr8wrno51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/l1pg7drtydg116axywbi.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461944763/ado0f0vjgfix4xlrxspj.jpg'),(54,97,16,'Crownstone','','Rotterdam',NULL,'Netherlands','','','Live project',NULL,13,19080,'Anne van Rossum','','Technology','','','',1,NULL),(55,101,15,'WoodRover','Luxury Wooden Bicycles','Kiev','','Kyiv city','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586835/i85k7hlipk0wq373ptv2.jpg','','Live project',NULL,150,54246,'Valeriy Gorbatov','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1','Sport','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586833/qk6umrauzyglbeohqxe5.jpg',1,NULL),(56,126,16,'Build Focus','Train yourself to concentrate, beat distraction, and get more done.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/z5iv8etb5ngy6ripuin3.jpg','<p><a href=\"http://www.buildfocus.io\"><strong>Build Focus</strong></a> is a productivity tool that trains your mind, to wean you off checking Facebook every five minutes and onto focused concentration, so you can beat distraction and get things done.</p>\n\n<p>Inspired by addictive games like World of Warcraft and Farmville, it puts gamification to use for good in your own head, and creates a powerful instant feedback loop that drives you towards concentration and focus, and out of distraction.</p>\n\n\n\n\n\n<p>Quit automatically opening Twitter when the going gets tough, and stop losing time to the internet; teach your brain better habits, kill distraction, and reach your goals.</p>','Beta project',NULL,259,59887,'Tim Perry','https://lh6.googleusercontent.com/-tmYaon1pd1E/AAAAAAAAAAI/AAAAAAAAXtQ/13GqxkStsMM/photo.jpgsz=200','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/u0pi6u3ictilp3njrdgu.jpg',1,NULL),(57,133,16,'MySeer','A simple gadget that helps you decide whether or not to bring an umbrella on your way out the door.','New York','','NY','','<p>Despite </p>','Beta project',NULL,28,69437,'Jarek Lupinski','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458705999/t75lmmi4lg40xsclhnrd.jpg','Technology','','','',1,NULL),(59,139,3,'Shelter','The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world','Annecy','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838787/ahudgcyrlyaboomjokzi.jpg','<p><strong>Shelter Woodsunglasses made in Annecy - A Thorough french manufacturing</strong></p>\n\n<p>Rooted in time, the Shelter brand was created in July 2013 following the resounding success won on the crowdfunding platform KissKissBanBank. In 45 days, we&nbsp;raised more than 18000 euros&nbsp;and 150 pre-orders for the manufacturing of pairs of sunglasses to be delivered in two months.&nbsp;Challenge taken up !</p>\n\n\n\n<p>Shelter has been a curious endeavor from the beginning. From our&nbsp;wood&nbsp;<em>workshop, based in the city of Annecy, they manufactured their sleek and timeless first collection. Each frame is unisex and made with a multilayer wooden structure the maximize the linkage between robustness, flexibility, lightness and comfort.</em></p>\n\n<p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462267456/u6cze2hufu2s9pznfd1f.jpg\" data-image=\"\"></figure><p><br></p><p>An endeavor to create a product that encompasses the individuality and uniqueness that can only be found in natural surroundings. A desire to experiment with design, materials and aesthetics in the search for something that works. Free from passing trends, the brand’s focus remains that of its roots, innovation and creation. Long live creativity.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462268340/wkfcrr7wk1ce7ihqovwd.jpg\" data-image=\"\"></figure><p><br></p><p><br></p>\n\n<p>The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world and are designed to arouse the curiosity of a community in search of authenticity and tradition.<br>Each frame is unique and has its own characteristic associated.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462266122/cdkcxhm3oezfhseoroha.jpg\" data-image=\"\"></figure><p><br></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1458917093/tf5br8h1fejjfo2zagha.mp4',490,61750,'Emeline Barat','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAK3ejroQCGdlCvsOo9FeLIwrEJkUsCipuYNahMREK5R','Design','50% 50%','tf5br8h1fejjfo2zagha','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838788/rawnvuyxehimfxqap42q.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462264482/ma6xayussknr5pj2w7ma.jpg'),(60,143,5,'hoop','Shoot a video and see what shoots back.','Tel Aviv Region','','Israel','','','Live project',NULL,1,61243,'Danielle Meyers','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAGtxDH1b9zB46ncDsD5HNe3qv97uqduVbUaluzNWUOG','Film & Video','','','',0,NULL),(61,145,11,'Cizoo','Cizoo app allows you to sing a message easily to your friends','Paris','','France','','','Live project',NULL,6,47092,'Sebastien Debry','','Music','50% 50%','','',1,NULL),(62,149,16,'Bisly.co','','Paris',NULL,'France','','','Live project',NULL,5,57690,'Jeremie Nacache','','Technology','','','',1,NULL),(63,150,16,'el needO','','Albi',NULL,'France','','','Beta project',NULL,2,69378,'El Needo','','Technology','','','',1,NULL),(93,165,3,'D-TWELVE Lamp','Explore the infinite ways of using the first modular, versatile and customizable handmade LED lamp','Rome','','Metropolitan City of Rome','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313131/g4hsua4buorgtpni2fzk.jpg','<p>Plato Design is running a crowdfunding campaign ending May 16th 2016 to start D-TWELVE production. Please have a look <a href=\"http://kck.st/1qeVfnx\">here</a>.</p>','Live project',NULL,40,11308,'Plato Design','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461312900/stsqh5mukmthqx5ltmmo.jpg','Design','0px -12px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313119/invmzhb4hgxlvmt8kno0.jpg',1,NULL),(124,1,9,'Test_Private','This project is a test','Toronto','','ON','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461764422/odmm1zc5zrswt7mwmylf.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/zq5HFwPNcAo\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n<p>zrgegerg</p>\n\n<p>zgegzegzeg</p>\n\n<p>egzegzeg</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461764472/a78sk1k1h15uite5gzhj.mp4',4,83886,'Quentin Verriere','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIe','Heritage','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461764422/ry8ttraerdligfjadtfz.jpg',0,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461764494/vix4bbla6uqomwau6qru.jpg'),(125,169,16,'Blckbox','System which detects when the user is in trouble and alerts friends and family in that case.','Xalapa','','Mexico','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766888/mbllvdqrotykz49004yt.jpg','<p>Our two co-founders met in an innovation bootcamp in Mexico, where they realised they have lived a similar situation in their lives which is worth solving: Both suffered a kidnapping case in their family. The plan was to create a solution that combats the problem.</p><p>But is has become so much more. Blckbox is now steering at the direction of mainly being a service which alerts the safe and sound arrival at a destination of people\'s loved ones. Additionally, when a problem is being detected by the service (mobile app + web platform), an alert is being sent.</p>','Drafted project',NULL,89,25450,'Marc Backes','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766602/dn0bp1zpvkr6kucmt8sx.jpg','Technology','0px -387px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766889/zq27qimwgtcumbdickh4.jpg',1,NULL),(126,174,1,'aaa','','Istanbul','','İstanbul','','','Idea',NULL,6,74792,'Ahmet Sergen DAYANIKLI','https://lh3.googleusercontent.com/-nYaKm0UUUds/AAAAAAAAAAI/AAAAAAAAAZ8/UNRg1u5LqAE/photo.jpgsz=200','Art','','','',1,NULL),(128,186,16,'Democracity','Participatory democracy through open innovation','Bucharest','','Romania','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917807/e2fsrpxq4xccnlau84eu.jpg','<p>Globalization<br> in its current asymmetrical form demonstrated to be incapable of <br>reducing inequalities in the world as it has let to the emergence of <br>“winners” and “losers”. While market forces demonstrated to be a non <br>sufficient mean to lead to the most efficient allocation of resources, <br>these governments and institutions have failed to meet the needs of the <br>Common Good and bring society together to solve global issues.</p>\n\n<p><i></i></p><i>\n\n</i><p><i>It is widely felt that socio-economic needs are not being addressed, <br>few believe that state institutions act in their best interests, and <br>many communities are dissatisfied with their economic situations. <br>Entrenched power systems tend to favour a selected minority while <br>reinforcing inequalities and discouraging social integration. Surveys <br>indicate that a growing majority of individuals feel they have no <br>control or influence over the economic, political and social factors <br>that affect their lives. The hopes, the aspirations and concerns of <br>those who have no chance to express themselves are frequently overlooked<br> and ignored. Moreover, the urgent environmental problems, the <br>incapability of this type of democracy (accountability problems, <br>legitimacy problems, corruption) and of the market alone to handle them,<br> request a totally fresh approach.<br></i></p>','Idea','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461917926/zxvy6otv6qohhahdccqd.wmv',44,95540,'Manu Musa','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917477/zchgzb7k9pc0ctvyyq8r.jpg','Technology','0px -224px','zxvy6otv6qohhahdccqd','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917807/dl6wax43uaqe7tu2n0c5.jpg',1,NULL),(129,7,16,'Virtual Receipt','Storing all your receipt inside your smartphone and get access to them whenever you want.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462031765/xs0fqteypxbjf0u1v87j.jpg','<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462031832/vkykpqojgaqljihc1qg7.jpg\" data-image=\"\"></figure>','Idea',NULL,12,16029,'Maxence Mson','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458587075/ejrk6p8i4fxn8qqfg87l.jpg','Technology','0px -137px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462031773/kdzo5hap81xkprooo0kt.jpg',0,NULL),(130,201,5,'hoop','Where videos gain momentum and evolve into “social video chains” triggered by trends and memes.','Tel Aviv-Yafo','','Israel','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462106301/rvhluuf9ij2ywnyrefyu.jpg','<p><strong>About hoop</strong></p>\n\n<p>Hoop is introducing a new dimension to mobile video. It’s where your videos gain momentum and evolve into “social video chains” triggered by trends, topics and memes. Currently available on iOS, hoop’s app is a continuous experience enabling people to easily switch between watching or joining the creations of others, helping to build dynamic content that’s bigger than the sum of the parts. <br><br><strong class=\"redactor-inline-converted\">How it works</strong><br></p>\n\n\n\n<p>Users can participate in three ways: They can start their own chain by uploading or creating an initial 15-second video. They can also join an existing chain by responding with their own video. Or they can simply upvote individual videos. Upvoted videos move higher up in their &nbsp;chain. Chains can be discussions, trends, compilations, challenges, memes or anything else that can be developed collectively and have a topic or a theme. Current categories include Dance, Sports, Fashion, Animals and more. Creators who start a chain are spotlighted as originators. Each chain has potential to grow dynamically and evolve into new directions with each new video addition and moment.</p>','Live project',NULL,1,63969,'Danielle Meyers','https://lh3.googleusercontent.com/-t96teT8wsjU/AAAAAAAAAAI/AAAAAAAAABY/pYC_JotZCm8/photo.jpgsz=200','Film & Video','0px -169px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462106303/gizevesybgui50s1ns3p.jpg',0,NULL),(131,206,7,'Mayium','','Lille','','France','','','Drafted project',NULL,1,20532,'Guillaume Etienne','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462135573/iczadzujwuuatlqzdkuy.jpg','Games','','','',0,NULL),(132,229,16,'Recast.AI','A collaborative Bot Platform, build your own bot!','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225606/nlchqmg59edaj12rind6.jpg','','Live project',NULL,20,38714,'Jasmine Anteunis','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225405/d5xgkhanvunde36db58m.jpg','Technology','0px -215px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225605/etqwjrzzus4uf2xsqpnp.jpg',1,NULL),(133,241,16,'WIZPAY','Started in 2013 a mobile marketplace, working with the QR technology.\nProject well advanced.','Bruges','','Belgium','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462274148/xrdbcbgdu22xfmtoryie.jpg','<p>Want to revolutionize the way we shop !!</p><p>WizPay wants to make it easier for sellers and buyers to buy thanks to a multi functional marketplace.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1462274283/zvh0npedehoffevbsnrf.mp4',27,90010,'Maximilien Lejeune','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZ','Technology','0px -393px','zvh0npedehoffevbsnrf','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462274148/tuow9d5b3uyk5xqhjzze.jpg',1,NULL),(134,251,16,'Synervoz','Synervoz, a Techstars backed company, focuses on always-on voice communication applications.','London','','United Kingdom','','<p>We are looking for an experienced iOS developer to rebuild our music & communications app. You can learn more about our product(s) here:&nbsp;<a href=\"http://www.synervoz.com/\">www.synervoz.com</a></p>\n\n\n\n\n\n<p>We are part of Techstars’ Virgin Media accelerator, and we are looking for someone who can join us in the office in East London (Aldgate East) for at least part of the contract. We have an iOS app on the App Store today, but the code base has become unwieldy and is in need of a total overhaul. The job would start with a white board session including yourself, the CTO, and the CEO. Together we will determine the best architecture given lessons learned to date, and future plans. This is not a job for a beginner. We are looking for experience in the following areas:</p>','Live project',NULL,0,71740,'James Meier','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462356780/lgfzbuir8ejcpaf4aoki.jpg','Technology','','','',1,NULL),(135,255,16,'VisiOmfortable','We want to use the sun vizor (that\'s part of almost every motorcycle helmet) as frame for glasses.','Neuchâtel','','Switzerland','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462390645/oaxupqwfip8ioekam9xq.jpg','<p>1)&nbsp;Wearing glasses under a&nbsp;motorcycle helmet can be very uncomfortable.</p>\n\n<p><br></p>\n\n\n\n<p>2) Sure, you might wanna&nbsp;switch to contact lenses. But some people just don\'t support them. Or you don\'t always carry them around. So wouldn\'t it be great if you didn\'t have to put neither glasses nor contacts, but just the helmet?</p>\n\n\n\n<p><br></p>\n\n\n\n<p>3) Producing a corrected helmet vizor suddenly&nbsp;seems tempting, doesn\'t it?</p>\n\n\n\n<p><br></p>\n\n\n\n<p>4) Unfortunately, the distance between the eye and the vizor is too large. And also the&nbsp;vizor is way too curved.</p>\n\n\n\n<p><br></p>\n\n\n\n<p>5) But hey, there\'s another thing built in most of the helmets - a sun shade that can be slid down right in front of your eyes.&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n<p>6) Guess what: the distance of the sun vizor&nbsp;is the same as with&nbsp;regular glasses, and the curving is much less extreme.</p>\n\n\n\n<p><br></p>\n\n\n\n<p>7) SO WHY&nbsp;NOT&nbsp;JUST&nbsp;USE&nbsp;THE&nbsp;SUN&nbsp;VIZOR&nbsp;AS&nbsp;A&nbsp;FRAME&nbsp;FOR&nbsp;YOUR&nbsp;SPECS?</p>\n\n\n\n<p><br></p>\n\n\n\n<p>8) That\'s what we want to do. Help us - we know it\'s possible, but we don\'t have neither the material nor the expertise to build the prototype.&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n<p>9) See you ;-)</p>\n\n\n\n\n\n<hr><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462391477/qgjspzphuaaakj0aggey.jpg\" data-image=\"\"></figure>','Drafted project',NULL,66,10484,'Lukas Langhart','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAE8sAAzDZCoSoMl5PF7f4pTOZCgSml3Ax1vYROQ5kE3','Technology','0px -45px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462390645/xcly1zf9vayykuy5dsrs.jpg',1,NULL),(136,256,3,'Lockstone','Capture and enhance the life of your favourite fragrance with Lockstone.','Leeds','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394603/kldkte0412khgkhac0ne.jpg','<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394671/wpt43bohizrqqf4wwgya.jpg\" data-image=\"\"></figure><h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393679/zbp6fgfb5etvl3fl3ulq.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>The revolutionary Lockstone range: crafted from a meticulous study of nature to capture and enhance the life of your fragrances.</p>\n\n\n\n\n\n<p><br>Inspired by nature, developed by science and designed with a focus upon minimalist, streamlined aesthetics.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393715/y8usqrmpb2jvoortfqey.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>Capture and enhance your fragrance. &nbsp;Whatever your scent – Lockstone captures it – Just spray with your favourite fragrance and it will last approximately seven times longer than wearing your fragrance without it.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393809/oklxiaim1lvtqdw6t30p.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>We’ve harnessed a high-tech polymer, and combined it with precision turned metal – meaning that Lockstone items will look as good today as they will tomorrow and for years to come; all with a reassuring weight of quality while light enough to go unnoticed when worn.<br></p>\n\n\n\n\n\n<figcaption>The pendant, in a range of designs, can be worn by men and women<br></figcaption>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393854/xgcnqazaatpng5le4vbd.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393874/lu93h6z0igevcspeou5v.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Easy to charge with any fragrance. Just allow 4 minutes for the fragrance to absorb.</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393893/sxveitpitxlijjr9qi8x.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Customise your range with your own fragrance.</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393909/iyl3dfvjtihpot6omdyq.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>The Lockstone range allows your fragrance to last the day</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393927/cngtcpmqmvbmosmnizql.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Available in a range of precious metals</figcaption></figure>\n\n\n\n\n\n<p>The pumice stone: on the outside it’s an incredibly simple object – yet within it are thousands of intricate structures – structures that make for micro aerated pathways, allowing this otherwise innocuous item to absorb and retain moisture for long durations.</p>\n\n\n\n\n\n<p><br>This naturally created material has been under the microscope within our labs – where we’ve been able to harness micro-porous structures to create a revolutionary material.</p>\n\n\n\n\n\n<p><br>This all-new, patent pending material draws fragrance in, slowly releasing the scent over a long duration. For you this means longer lasting and better performing fragrances – where expensive designer scents enjoy a longer life and through which an aroma can be sustained far beyond a single day’s wear.</p>\n\n\n\n\n\n<p><br></p>\n\n<h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393970/sme02alo6zbgu74sglhe.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<h1>Pendants</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393990/wuxgnaduma12khbsiqlg.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>We\'ve reinvented the classic piece that is the pendant; through a focus upon clean lines and an impactful, minimalist design we’ve created an item that delivers long lasting aroma whilst equally adding subtle style to any outfit. For men, for women, for the formal and for the every day.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Each of our pendants are simply infused with any given fragrance via the stem. Our breakthrough material then emanates scent as the stem warms against the skin.</p>\n\n\n\n\n\n<h1><br>Cufflinks&nbsp;</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394023/hjqf2wwb6pyxbzrhtfcu.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>Through combining machine turned stainless steel and brass with classic style we’ve found powerful partners, creating a design that is as practical as it is elegant.&nbsp;Our cuff links are perfect for anyone who is allergic to commercial fragrance, as the fragrance is not in contact with the skin.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>Plus Collection</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394057/udrngeqxtvt2dwfxrikh.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394071/ozywn1ljvmbjgzsmvljr.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><br></figure>\n\n\n\n\n\n<p>Stainless steel will retain a timeless quality and shine throughout its life. Brass and copper will become unique to you as they age and patina naturally, giving yours a finish like no other.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394095/lljjwlwsogjbtkx3gcfo.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394104/c6nyi1b1ujndtljs5sb8.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394116/ais4m3qthlz7mjfscngh.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<ul><li><strong>Step 1:&nbsp;</strong>Invert your Lockstone and spray with your favourite fragrance; watch as the liquid saturates and is then gradually absorbed.&nbsp;</li><li><strong>Step 2:</strong>&nbsp;Leave upright for a few minutes – allowing the fragrance to be fully infused into the Lockstone.</li><li><strong>Step 3:&nbsp;</strong>Your fragrance will then be locked within the stone and through its micro absorbent structure your scent will be gradually released through contact with the skin</li></ul>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394208/sa2wnl1fkla2jxpulkwx.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394224/lyi1j6akzbyyi7hpnyja.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394230/rqmyn2ndqbkckxfq1cx4.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394237/mdpufequq0nrefkvygaq.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394254/vdae0qqhhd9qpdrpqs7k.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><strong><em>Accidental beginnings</em></strong>&nbsp;</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>Lockstone emerged from a series of failed attempts at creating a new way of producing wallets; it was throughout this process that we noticed the materials we were working with remained damp – even after the washing and drying process, an occurrence that was to become quite the annoyance.<br>Yet this frustration would soon turn to curiosity, and we began to ponder just how this natural characteristic could be harnessed for something useful – and with that, our focus was shifted to refining a material to lock in fragrances.</p>\n\n\n\n\n\n<p><br><strong><em>Metal: A perfect partner to the Lockstone</em></strong><br>The design development phases were filled with exploration as to how the Lockstone could and should be teamed with other materials; pure metals seemed a natural fit to a project that had, by then, become defined by purity and refined by a focus upon simplicity. Equally, metals provided for a contrast, whilst delivering an uncompromising design that could elegantly withstand the rigours of everyday use.<br>By tapping into CNC turning we were then able to achieve perfect geometry – ultimately creating the timeless design that you see before you today: a design that goes on to also deliver rigidity and practicality for easy, stylish everyday use.</p>\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n<p><em><strong>About Us</strong></em></p>\n\n\n\n\n\n<p><em><br></em></p>\n\n\n\n\n\n<p><em><strong></strong>We\'re a small team of designers (and Ryan) that strive to develop innovative everyday products in terms of their function, aesthetic and materials. &nbsp;<br>Kickstarter has been the foundation of our business, starting all the way back in September 2014 with our first campaign for Carbon. Since then, we have launched two more campaigns, Stealth and also our first timepiece.&nbsp;<br>&nbsp;At the end of the day, we\'re designers with a passion for innovation,&nbsp;focusing&nbsp;on a minimalist approach to create and develop new products for everyday use. Lockstone is our first foray into the world of&nbsp;jewelry.&nbsp;We wanted to bring our minimalist approach and apply it to a range of&nbsp;jewelry&nbsp;that also pushed the function of&nbsp;jewelry&nbsp;in the everyday. With that, we introduce Lockstone to Kickstarter as the ultimate platform for innovation and development.<br></em></p>\n\n\n\n\n\n<p><br></p>','Idea','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1462392032/u5wxjuqenudwwepaonpy.mp4',331,95002,'Sean Sykes','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAOWdZByrMXTJt5ChY6g0dm4p6KlDkR9gWav3kyhXVNj','Design','0px 0px','u5wxjuqenudwwepaonpy','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394603/wsg06ro8p6vqjmjjxdwe.jpg',1,NULL),(137,257,16,'Réseau social','Bonjour, je suis à la recherche d\'un partenaire dev technique pour la création d\'un réseau social','Paris','','France','','','Idea',NULL,11,48587,'Malick Ito','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462367082/pc0qtrivwv7m7p8gwrg3.jpg','Music','','','',1,NULL),(138,258,12,'One Third Stories','Stories that start in English & end in a different language, by gradually introducing foreign words.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462368413/oafvpyhuxdicpco8u13y.jpg','<figure></figure><h3>Easy language learning for kids with stories that start in one language and end in another.</h3>\n\n<p><br></p><p>Language education is broken</p><p>Languages have so many cognitive, social and economic benefits. But in the UK, we struggle with boring lessons and grammar-heavy textbooks, which destroy interest from an early age. With all that to contend with, it’s no wonder that 58% of us regret not learning another language in school.<br></p><p><br></p><p>Our solution</p><p>We create stories that start in English and end in a different language, by gradually introducing foreign words in easy to understand contexts. We call this way of learning The&nbsp;Clockwork Methodology<the clockwork=\"\" methodology=\"\">®.<br>Our vision is to encourage children to love languages by making learning them as simple as reading a story. So far, we’ve done that with the prototype app you can see in the video and audiobooks (available for free from our website!). We’re also running a Kickstarter in May to make our very first hardback book.</the></p><p><the clockwork=\"\" methodology=\"\"><br>The Clockwork Methodology®<br>Here’s an example of The Clockwork Methodology<the clockwork=\"\" methodology=\"\">®&nbsp;in action.</the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><em>“The little boy looked at the sky and saw the bright, round, yellow&nbsp;</em><em><strong>sol</strong>”</em></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><em></em>You’ve just learnt the Spanish word for ‘sun’ simply by having it introduced in context! When this happens in our stories, we repeat the word lots of times. Words are built into phrases and phrases become whole pages in another language.</the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>The&nbsp;Clockwork Methodologyy<the clockwork=\"\" methodology=\"\">®&nbsp;works because it helps children learn a new language in the same way that they expand their vocabulary in their native tongue. We developed it while studying at university and have had hundreds of teachers, parents, and children help us to improve it.</the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Our Story<br>Alex and Jonny met almost eight years ago when Alex moved to the UK from Paraguay. During 6th form, they took part in a Young Enterprise project together with 10 other friends and created a book about a little girl and a penguin travelling the world and learning about foreign languages and cultures.<br>Jonny struggled with French lessons when he was at school. But when he was studying English Literature and Linguistics at university, he had an idea about how to help children today learn languages more effectively.</the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462398314/vd89jjfk4vq7fwpgl8me.jpg\"><br></the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\">Alex all penguin\'ed up</the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>That idea came from reading Anthony Burgess’&nbsp;<em>A Clockwork Orange</em>. A hyper-violent novel about a dystopian future might seem like a strange inspiration for a children\'s’ book, but Jonny was intrigued by the way the story worked in words from a made-up Russian dialect.</the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Alex brought his language-learning expertise to the the project, and the two tinkered with the idea until the&nbsp;Clockwork Methodologyy®<the clockwork=\"\" methodology=\"\">&nbsp;was born. The pair founded One Third Stories and have been working to inspire more children to love and learn languages ever since.<br></the></the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\">You can download one of our free audiobooks to learn French or Spanish now.&nbsp;</the></the></the></the></p><p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><a href=\"http://onethirdstories.com/audiobooks/\">http://onethirdstories.com/audiobooks/</a><br></the></the></the></the></p>','Live project',NULL,159,31647,'Alex Somervell','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJoaormGWRZCm3h1Djvl7ZAhxe14fQHqHVONuwZAwf0','Publishing','0px -224px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462368408/ddibkmsdoe5bujhfw7z9.jpg',1,NULL),(139,256,3,'Lockstone','Capture and enhance the life of your fragrance with Lockstone.','Leeds','','United Kingdom','','','Idea',NULL,21,87750,'Sean Sykes','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAOWdZByrMXTJt5ChY6g0dm4p6KlDkR9gWav3kyhXVNj','Design','','','',1,NULL);
